import React from "react";

const Errorpage = () =>{
    return(
        <>
        <div id="notfound">
            <div className="notfound">
                <div className="notfound-404">
                    <h1>404</h1>
                </div>
                <h2>We are sorry page not found</h2>
            </div>
        </div>
        </>
    )
}

export default Errorpage;
